import React, { useState } from 'react';
import { auth } from '../config/firebase';
import { createUserWithEmailAndPassword } from 'firebase/auth';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import {
  Container,
  TextField,
  Checkbox,
  FormControlLabel,
  Button,
  Typography,
  Grid,
  Paper,
  FormGroup,
} from '@mui/material';
import { styled } from '@mui/system';

const StyledForm = styled('form')({
  display: 'flex',
  flexDirection: 'column',
  gap: '16px',
  width: '100%',
});

const LandlordSignUp = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [name, setName] = useState('');
  const [phone, setPhone] = useState('');
  const [propertiesOwned, setPropertiesOwned] = useState('');
  const [city, setCity] = useState('');
  const [propertyName, setPropertyName] = useState('');
  const [propertyAddress, setPropertyAddress] = useState('');
  const [bedrooms, setBedrooms] = useState(1);
  const [bathrooms, setBathrooms] = useState(1);
  const [description, setDescription] = useState('');
  const [propertyCertificateNumber, setPropertyCertificateNumber] = useState('');
  const [squareFootage, setSquareFootage] = useState('');
  const [coverPhoto, setCoverPhoto] = useState(null);
  const [amenities, setAmenities] = useState({
    pool: false,
    gym: false,
    laundry: false,
    dishwasher: false,
    aircon: false,
    balcony: false,
  });

  const navigate = useNavigate();

  const handleSignUp = async (e) => {
    e.preventDefault();
    try {
      if (!/^1|2|3|4|5/.test(propertyCertificateNumber)) {
        alert('Certificate invalid, verification unsuccessful.');
        return;
      }

      const userCredential = await createUserWithEmailAndPassword(auth, email, password);
      const firebaseUID = userCredential.user.uid;

      const selectedAmenities = Object.keys(amenities).filter((amenity) => amenities[amenity]);

      await axios.post('/api/users/landlord', {
        firebaseUID,
        email,
        name,
        phone,
        city,
        propertiesOwned,
        propertyName,
        propertyAddress,
        bedrooms,
        bathrooms,
        description,
        propertyCertificateNumber,
        squareFootage,
        amenities: selectedAmenities,
        coverPhoto,
      });

      navigate('/login');
    } catch (error) {
      console.error("Error signing up:", error);
      alert(error.message);
    }
  };

  const handleCoverPhotoChange = (e) => {
    setCoverPhoto(e.target.files[0]);
  };

  const handleAmenityChange = (e) => {
    const { name, checked } = e.target;
    setAmenities((prevAmenities) => ({
      ...prevAmenities,
      [name]: checked,
    }));
  };

  return (
    <Container maxWidth="sm" sx={{ mt: 5 }}>
      <Paper elevation={3} sx={{ padding: 4 }}>
        <Typography variant="h4" gutterBottom align="center">
          Landlord Sign Up
        </Typography>
        <StyledForm onSubmit={handleSignUp}>
          <TextField label="Email" value={email} onChange={(e) => setEmail(e.target.value)} required fullWidth />
          <TextField label="Password" type="password" value={password} onChange={(e) => setPassword(e.target.value)} required fullWidth />
          <TextField label="Name" value={name} onChange={(e) => setName(e.target.value)} required fullWidth />
          <TextField label="Phone" value={phone} onChange={(e) => setPhone(e.target.value)} required fullWidth />
          <TextField label="City" value={city} onChange={(e) => setCity(e.target.value)} required fullWidth />
          <TextField label="Properties Owned" type="number" value={propertiesOwned} onChange={(e) => setPropertiesOwned(e.target.value)} fullWidth />
          <TextField label="Property Name" value={propertyName} onChange={(e) => setPropertyName(e.target.value)} fullWidth />
          <TextField label="Property Address" value={propertyAddress} onChange={(e) => setPropertyAddress(e.target.value)} fullWidth />
          <TextField label="Bedrooms" type="number" value={bedrooms} onChange={(e) => setBedrooms(e.target.value)} inputProps={{ min: 1, max: 10 }} fullWidth />
          <TextField label="Bathrooms" type="number" value={bathrooms} onChange={(e) => setBathrooms(e.target.value)} inputProps={{ min: 1, max: 10 }} fullWidth />
          <TextField label="Description" multiline maxRows={4} value={description} onChange={(e) => setDescription(e.target.value)} fullWidth />
          <TextField label="Property Certificate Number" value={propertyCertificateNumber} onChange={(e) => setPropertyCertificateNumber(e.target.value)} required fullWidth />
          <TextField label="Square Footage" type="number" value={squareFootage} onChange={(e) => setSquareFootage(e.target.value)} fullWidth />

          <Typography variant="subtitle1" gutterBottom>Amenities:</Typography>
          <FormGroup row>
            {Object.keys(amenities).map((amenity) => (
              <FormControlLabel
                key={amenity}
                control={
                  <Checkbox
                    name={amenity}
                    checked={amenities[amenity]}
                    onChange={handleAmenityChange}
                  />
                }
                label={amenity.charAt(0).toUpperCase() + amenity.slice(1)}
              />
            ))}
          </FormGroup>

          <Button variant="contained" component="label">
            Upload Cover Photo
            <input type="file" hidden onChange={handleCoverPhotoChange} />
          </Button>

          <Button type="submit" variant="contained" color="primary" fullWidth sx={{ mt: 2 }}>
            Sign Up as Landlord
          </Button>
        </StyledForm>
      </Paper>
    </Container>
  );
};

export default LandlordSignUp;
